def coprime_nim(n, k):
    # Initialize the dp table
    dp = [[0] * (n + 1) for _ in range(k + 1)]

    # Base cases
    for i in range(1, n + 1):
        dp[1][i] = 1

    # Iterate over the number of piles
    for i in range(2, k + 1):
        # Iterate over the number of stones in the pile
        for j in range(1, n + 1):
            # Iterate over all possible moves
            for move in range(1, j + 1):
                # If the move is coprime with the number of stones in the pile
                if gcd(move, j) == 1:
                    # The current position is a losing position if all the next positions are winning positions
                    if all(dp[i - 1][j - move * x] == 0 for x in range(1, n // move + 1)):
                        dp[i][j] = 1
                        break

    # Return the number of losing starting positions
    return dp

