def pandigital_triangles(n):
    """
    Find the sum of the largest sides of all n-pandigital triangles with 9n18.
    """
    # Generate all n-pandigital numbers.
    pandigitals = set()
    for i in range(1, n + 1):
        pandigitals.add(int(''.join(map(str, range(1, n + 1)))))

    # Find all n-pandigital triangles.
    triangles = set()
    for a in pandigitals:
        for b in pandigitals:
            for c in pandigitals:
                if a + b > c and a**2 + b**2 == c**2:
